def dirac(x):
    if isinstance(x, (int, float)):
        if x == 0:
            return float('inf')
        else:
            return 0
    elif isinstance(x, np.ndarray):
        return np.zeros_like(x)
    else:
        raise ValueError("Unsupported input type. Only int, float, and numpy array are supported.")

